<script type="text/paperscript" canvas="myCanvas">
$('#small_cloud').css("visibility", 'hidden')
$('#small_cloud2').css("visibility", 'hidden')
$('#medium_cloud').css("visibility", 'hidden')
$('#plane').css("visibility", 'hidden')
$('#background').css("visibility", 'hidden')


var canvas= document.getElementById( 'myCanvas' );
paper.setup(canvas);

var mousePos = view.center + [view.bounds.width / 2, 100];
var position = view.center;

function onFrame(event) {
    position += (mousePos - position) / 20;
    var vector = (view.center - position) / 10;
    moveStars(vector*3);
}

// function onMouseMove(event) {
//     mousePos = event.point;
//     console.log(mousePos)
// }

function onKeyDown(event) {
    if(event.key == 'a') {
        mousePos -= position.x/10;
    }

    if(event.key == 'd') {
        mousePos += position.x/10;
    }

    if(event.key == 'w') {
        mousePos -= position.y/10;
    }

    if(event.key == 's') {
        mousePos += position.y/10;
    }
    console.log(mousePos)
}

// function onKeyDown(event) {
//     if (event.key == 'space')
//         project.activeLayer.selected = !project.activeLayer.selected;
// }

var moveStars = new function() {
    // The amount of symbol we want to place;
    var count = 50;

    // Create a symbol, which we will use to place instances of later:
    var smallCloud = project.importSVG(document.getElementById('small_cloud'))

    var symbol = new Symbol(smallCloud);

    // Place the instances of the symbol:
    for (var i = 0; i < count; i++) {
        // The center position is a random point in the view:
        var center = Point.random() * view.size;
        var placed = symbol.place(center);
        placed.scale(i/25);
        placed.opacity = (i/count);
        placed.data = {
            vector: new Point({
                angle: Math.random() * 360,
                length : (i / count) * Math.random() / 5
            })
        };
    }

    var vector = new Point({
        angle: 45,
        length: 0
    });

    function keepInView(item) {
        var position = item.position;
        var viewBounds = view.bounds;
        if (position.isInside(viewBounds))
            return;
        var itemBounds = item.bounds;
        if (position.x > viewBounds.width + 5) {
            position.x = -item.bounds.width;
        }

        if (position.x < -itemBounds.width - 5) {
            position.x = viewBounds.width;
        }

        if (position.y > viewBounds.height + 5) {
            position.y = -itemBounds.height;
        }

        if (position.y < -itemBounds.height - 5) {
            position.y = viewBounds.height
        }
    }

    return function(vector) {
        // Run through the active layer's chilren list and change
        // the position of the placed symbols:
        var layer = project.activeLayer;
        for (var i = 0; i < count; i++) {
            var item = layer.children[i];
            var size = item.bounds.size;
            var length = vector.length / 20 * size.width / 10;
            item.position += vector.normalize(length)/10 + item.data.vector;
            keepInView(item);
        }
    };
};      

</script>
